import React from 'react';
import {SafeAreaView, View, FlatList, StyleSheet, Text, StatusBar,ImageBackground } from 'react-native';
import { DATA } from '../../utils/data';
import Cabecalho from './components/Cabecalho';
import {useFonts} from 'expo-font';


const ListaMisterios = () =>{

  const [loaded] = useFonts({
    MontserratSemiBold: require('../../../assets/fonts/Montserrat-SemiBold.ttf'),
  });

  if (!loaded) {
    return null;
  }
  
  return (
    <SafeAreaView style={{flex: 1, flexDirection: 'column'}}>

      <Cabecalho/>

        <View style={{alignItems: 'center'}}>
          <ImageBackground source={require('../../../assets/misterios/gozosos.jpg')} imageStyle={{ borderRadius: 5, height: 95}} style={{width: '80%'}}>
            <Text style={styles.textButtons}>Mistério Gozoso</Text>
          </ImageBackground>

          <ImageBackground source={require('../../../assets/misterios/luminosos.jpg')} imageStyle={{ borderRadius: 5, height: 95}} style={{}}>
            <Text style={styles.textButtons}>Mistério Luminoso</Text>
          </ImageBackground>

          <ImageBackground source={require('../../../assets/misterios/doloroso.jpg')} imageStyle={{ borderRadius: 5, height: 95}} style={{}}>
            <Text style={styles.textButtons}>Mistério Doloroso</Text>
          </ImageBackground>

          <ImageBackground source={require('../../../assets/misterios/gloriosos.jpg')} imageStyle={{ borderRadius: 5, height: 95}} style={{}}>
            <Text style={styles.textButtons}>Mistério Glorioso</Text>
          </ImageBackground>
        </View>
      
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
 textButtons:{
  fontFamily: 'MontserratSemiBold',
  fontSize: 22,
  color:'white', 
  textAlign: 'center',
  position: 'relative', 
  top: 35 
 }
});
export default ListaMisterios;
